import styled from 'styled-components';
import {Blueprint, Container, Title1, Ps4Controller} from '../index';

const BodyCircleLeft = styled.div`
    width: 303px;
    height: 303px;
    border: 1px solid #fff;
    border-radius: 50%;
    position: absolute;
    bottom: 0;
    left: 0;
`;

const BodyCircleRight = styled.div`
    width: 303px;
    height: 303px;
    border: 1px solid #fff;
    border-radius: 50%;
    position: absolute;
    bottom: 0;
    right: 0;
`;
const TouchPad = styled.div`
    border-bottom-right-radius: 8px;
    border-bottom-left-radius: 8px;
    border: 1px solid #fff;
    height: 275px;
    width: 485.5px;
    margin: auto;
`;
class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <Container>
                <Blueprint>
                    <Ps4Controller>
                        <TouchPad></TouchPad>

                        <BodyCircleRight></BodyCircleRight>
                        <BodyCircleLeft></BodyCircleLeft>
                    </Ps4Controller>
                </Blueprint>
            </Container>
        );
    }
}

export default Main;
